import { useSelector } from "react-redux";

const Cart = () => {
  const cart = useSelector((state) => state.cart.items);

  return (
    <div className="p-10 text-center">
      <h1 className="text-3xl font-bold mb-4">Keranjang Belanja</h1>
      {cart.length === 0 ? (
        <p className="text-lg">Keranjang Anda kosong.</p>
      ) : (
        <ul>
          {cart.map((item, index) => (
            <li key={index} className="border p-4 mb-2">{item.title} - ${item.price}</li>
          ))}
        </ul>
      )}
    </div>
  );
};
export default Cart;
